// App.js
import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Auth from "./Auth";
import Main from "./Main";

const App = () => {
  return (
    <Router>
        <Route path="/auth" component={Auth} />
        <Route path="/" component={Main} />
    </Router>
  );
};

export default App;
